import React, { useState } from 'react'
import './App.css';
import Header from './components/Header';
import BenchmarkDataFilter from './components/BenchmarkDataFilter'
import { customTheme } from './components/customTemplate';
import { ThemeProvider } from '@material-ui/core/styles';
import { lightTheme, darkTheme } from './components/themes.js';

function Themes()
{
  const [theme, setTheme] = useState('light');
  const themeToggler = () => {
      theme === 'light' ? setTheme("dark") : setTheme('light')
    }
};

class App extends React.Component {
  constructor(props){
  super(props);

  this.state = {
    themes: 'dark',
    }
  }

  handleCallback = (data) =>{
    this.setState({themes: data});
  }

  render() {
    return (
      <React.Fragment>

        <ThemeProvider theme={ this.state.themes === 'light' ? lightTheme : darkTheme }>
        {console.log(this.state.themes)}

              <Header callback = {this.handleCallback}/>
              <BenchmarkDataFilter />    

        </ThemeProvider>
      </React.Fragment>
    );
  }
}

export default App;
